    {id:'cg1',text:'This is'},
    {id:'c02',text:'This is2'},
    {id:'c03',text:'This is3'}
  ]

const addNewGoalhandler = (newGoal) =>{
  CourseGoals.push(newGoal);

} 

  return (
    <>
      <GoalList goals={CourseGoals}/>
      <NewGoal addGoal={addNewGoalhandler}/>
    </>
  );
}

export default App;
